// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

import "@openzeppelin/contracts-upgradeable/utils/ContextUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC20/ERC20Upgradeable.sol";

contract CreatorToken is OwnableUpgradeable, ERC20Upgradeable {
  uint256 private _mintReward;
  uint256 private _transferReward;
  IERC20 private _parent_token;

  function initialize(string memory _name, string memory _symbol, IERC20 parent_token_) public initializer {
    __Ownable_init();
    __ERC20_init_unchained(_name, _symbol);

    _parent_token = parent_token_;
    updateMintReward(10000);
    updateTransferReward(0);
  }

  function parent_token() public view returns (address) {
    return address(_parent_token);
  }

  function mintReward() public view returns (uint256) {
    return _mintReward;
  }

  function transferReward() public view returns (uint256) {
    return _transferReward;
  }

  function getMintCost(uint256 amount) public view returns (uint256) {
    return (totalSupply() + amount) - totalSupply();
  }

  function getBurnReward(uint256 amount) public view returns (uint256) {
    return (totalSupply() + amount) - totalSupply();
  }

  function updateMintReward(uint256 _reward) public onlyOwner {
    require(_reward <= 10000, "Creator rewards cannot exceed 100%");
    _mintReward = _reward;
  }

  function updateTransferReward(uint256 _reward) public onlyOwner {
    require(_reward <= 10000, "Creator rewards cannot exceed 100%");
    _transferReward = _reward;
  }

  function updateRewards(uint256 mintReward_, uint256 transferReward_) public onlyOwner {
    updateMintReward(mintReward_);
    updateTransferReward(transferReward_);
  }

  function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
    uint256 creatorReward = amount * _transferReward / 10_000;

    _transfer(_msgSender(), recipient, amount - creatorReward);
    _transfer(_msgSender(), owner(), creatorReward);
    return true;
  }

  function transferFrom(address sender, address recipient, uint256 amount) public virtual override returns (bool) {
    uint256 creatorReward = amount * _transferReward / 10_000;

    _transfer(sender, recipient, amount - creatorReward);
    _transfer(sender, owner(), creatorReward);

    uint256 currentAllowance = allowance(sender, _msgSender());
    require(currentAllowance >= amount, "ERC20: transfer amount exceeds allowance");
    unchecked {
      _approve(sender, _msgSender(), currentAllowance - amount);
    }

    return true;
  }

  function mint(uint256 amount) public returns(bool) {
    uint256 cost = amount;

    require(_parent_token.allowance(_msgSender(), address(this)) >= cost, "ERC20: Cannot mint tokens, insufficient funds");
    _parent_token.transferFrom(_msgSender(), address(this), cost);

    uint256 creatorReward = (amount * _mintReward) / 10_000;

    _mint(_msgSender(), amount - creatorReward);
    _mint(owner(), creatorReward);

    return true;
  }

  function burn(uint256 amount) public returns(bool) {
    _burn(_msgSender(), amount);
    require(payable(_msgSender()).send(getBurnReward(amount)), "ERC20: Could not transfer burning rewards");
    return true;
  }
}
